import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

const Box = styled.div`
  padding: 20px;
  border-radius: 20px;
  background-color: lightskyblue;
  min-width: 400px;
`;

const Input = styled.input`
  border-radius: 10px;
  padding: 5px 10px;
`;

const Title = styled.div`
  font-size: 40px;
  font-weight: 600;
  text-align: center;
  margin-bottom: 30px;
`;

function App() {
    return (
        <Wrapper>
          <Box style={{margin: "auto auto"}}>
              <Title>
                  Авторизация
              </Title>
              <Input placeholder={"Login"}/>
          </Box>
        </Wrapper>
    );
}

export default App;
